import React from 'react';

const buildings = [
    { id: 'A', name: 'Building A', x: 50, y: 50, width: 100, height: 100, color: '#999999' },
    { id: 'B', name: 'Building B', x: 200, y: 50, width: 120, height: 100, color: '#bbbbbb' },
    { id: 'C', name: 'Building C', x: 50, y: 200, width: 150, height: 100, color: '#cccccc' },
];

const CampusMap = () => {
    return (
        <svg
            viewBox="0 0 400 400"
            style={{ width: '100%', height: '100%', backgroundColor: '#cccccc' }}
        >
            {buildings.map((building) => (
                <g key={building.id}>
                    {/* Building Block */}
                    <rect
                        x={building.x}
                        y={building.y}
                        width={building.width}
                        height={building.height}
                        fill={building.color}
                        stroke="#000"
                        strokeWidth="2"
                    />
                    {/* Building Label */}
                    <text
                        x={building.x + building.width / 2}
                        y={building.y + building.height / 2}
                        textAnchor="middle"
                        dominantBaseline="middle"
                        fill="#000"
                        fontSize="16"
                        fontWeight="bold"
                    >
                        {building.id}
                    </text>
                </g>
            ))}
        </svg>
    );
};

export default CampusMap;
